    <nav>
        <ul className='flex justify-center items-center'>
          <li ><NavLink className={(navData)=>navData.isActive?styles.active:''} to="/">Home</NavLink></li>
          <li ><NavLink className={(navData)=>navData.isActive?styles.active:''} to="/about">About</NavLink></li>
          <li ><NavLink className={(navData)=>navData.isActive?styles.active:''} to="/search">search</NavLink></li>
        </ul>
    </nav>
  )
}

export default Header
